import { BrowserRouter as Router, Routes, Route,useParams } from 'react-router-dom'; 
import React from "react";

import MainSearch from "./components/MainSearch";
import AllFish from "./components/AllFish";
import FishCard from "./components/FishCard"
import './App.css';
class App extends React.Component{
  constructor(){
    super();
    this.state={
      allFish:[],
      compare:{fish_1_ID:"",fish_2_id:""},
      currentFish:{}
    }
  }

  componentDidMount(){
    fetch('https://acnhapi.com/v1a/fish')
    .then(resp=>resp.json())
    .then(json=>this.setState({allfishes:json}));
  }
  render=()=>{
    return (<main>
        <Routes>
            <Route path='/allfish' element={<AllFish allfishes={this.state.allfishes}/>}></Route>
            <Route path='/search'  element={<MainSearch/>}></Route>
            <Route path='/'  element={<MainSearch/>}></Route>
            <Route path='/fish/:id' element={<FishCard id={()=>{
               let {id}=useParams();
               return id;
            }}></FishCard>}></Route>
        </Routes>

    </main>)
  }
}



export default App;
